import React from 'react';

function Carousel(props) {
    return (
        <div>
            <Carousel wrapAround={true} slidesToShow={3}>
                <img src="https://12bb6ecf-bda5-4c99-816b-12bda79f6bd9.selcdn.net/upload/site_banners_main/8c/e0/8ce038653ca44c6460a65a63aa0563d922b170091b82141862b65a8a58fc9ef0.jpg" />
                <img src="https://12bb6ecf-bda5-4c99-816b-12bda79f6bd9.selcdn.net/upload/site_banners_main/3a/79/3a792047f6f3c91e24fa69048f5203a3a7e4148c5f0917bd685558c32b7cc64e.jpg" />

            </Carousel>
        </div>
    );
}

export default Carousel;
